	<title>My Profile Page</title>
	<style>
		body {
			margin: 0;
			padding: 0;
			font-family: Arial, sans-serif;
		}
		
		.header {
            background: linear-gradient(45deg, #405de6, #5851db, #833ab4, #c13584, #e1306c, #fd1d1d);
			color: white;
			padding: 20px;
			text-align: center;
		}
		
		.profile-picture {
			display: block;
			margin: 20px auto;
			width: 150px;
			height: 150px;
			border-radius: 50%;
			object-fit: cover;
			object-position: center;
			box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
		}
		
		.info {
			text-align: center;
			margin: 20px auto;
		}
		
		h1 {
			margin: 0;
		}
		
		.pictures {
			display: flex;
			flex-wrap: wrap;
			justify-content: center;
			margin: 20px auto;
			max-width: 1000px;
		}
		
		.picture {
			flex-basis: calc(33.33% - 20px);
			margin: 10px;
			border: 1px solid #ddd;
			border-radius: 5px;
			overflow: hidden;
			box-shadow: 0 0 5px rgba(0, 0, 0, 0.3);
		}
		
		.picture img {
			display: block;
			width: 100%;
			height: auto;
			object-fit: cover;
			object-position: center;
			transition: transform 0.3s ease-in-out;
		}
		
		.picture:hover img {
			transform: scale(1.1);
		}
        .profile-actions {
    display: flex;
    align-items: center;
    margin-left: 380px;
    width: 25px;
    height: 25px;

  .profile-action {

    color: #fff;
    text-decoration: none;
    border-radius: 5px;
    font-weight: bold;
    transition: background-color 0.2s ease;
    height: 20px;
    width: 100px;
    
  }
	</style>
